import React from 'react'

function BorrowandReturn() {
    return (
        <div className="card">
            <div className="mx-auto max-w-7xl px-2 sm:px-6 lg:px-8 container mt-5">
                <h1 className="text-2xl font-bold">Hello, World!</h1>
                <p className="mt-4">This is a Tailwind container.</p>
            </div>
        </div>
    )
}

export default BorrowandReturn
